import Form from 'react-bootstrap/Form';

function Permission({ Menuitem }) {
  return (
    <tbody>
          <tr>
            <td>{Menuitem.title}</td>
            <td> <Form.Check // prettier-ignore
        type="switch"
        id="custom-switch"
        label="Check this switch"
      /></td>
            <td>{Menuitem.edit}</td>
            <td>{Menuitem.remove}</td>
          </tr>
        </tbody>
  );
}
export default Permission;
